import React from "react";

export default function formatDate(props) {
  console.log(props.date.getDay());
  let days = [
    "Sunday",
    "Monday",
    "Thursday",
    "Wednesday",
    "Thuersday",
    "Friday",
    "Saturday",
  ];
  return "Saturday 12:03";
}
